import React, { useEffect } from 'react';
import styles from './UserTests.module.scss';
import { NavLink, Navigate } from 'react-router-dom';
import useAuthStore from '../../stores/authStore';

const UserTests = () => {
    const getTests = useAuthStore(state => state.getUserTests);
    const tests = useAuthStore(state => state.tests);
    const isLogged = useAuthStore(state => state.isLogged);
    const user = useAuthStore(state => state.user);



    useEffect(() => {
        if (isLogged && user) {
            getTests(user._id);
        }
    }, [isLogged])

    return (
        <>{isLogged ?
            <div className={styles.main}>
                {tests ? <>

                    <h1>My Tests :D</h1>

                    <ul className={styles.testList}>
                        {tests.map(test => (
                            <NavLink key={test._id} className={styles.navLink} to={`/test/${test._id}`}>
                                <li className={styles.testItem}>
                                    <div className={styles.titleDateDiv}>
                                        <h2 className={styles.testTitle}>{test.name}</h2>
                                        <p className={styles.testDate}>{test.createdAt.split('T')[0]}</p>
                                    </div>
                                    <p className={styles.testAuthor}>{user?.username}</p>
                                    <p className={styles.testDescription}>{test.description}</p>
                                </li>
                            </NavLink>
                        ))}
                    </ul>
                </> : <ul className={styles.testList}><li className={styles.testItem}><h1 style={{ fontSize: '2rem' }} className={styles.testTitle}>Loading...</h1></li></ul>

                }
            </div> : <Navigate to={`/auth/login`} />}</>
    );
};

export default UserTests;
